Максим, молодец! Грамотную речь слышать приятно. Вам в помощь:
Причины прийти и сказать НЕТ "Скажи нет вечному Путину!":
1) усложним фальсификации, добавим хлопот нашим врагам;
2) пусть нарушают закон и боятся;
3) наверняка, если будет заметная явка, желающих нарушать станет меньше - хотя бы покажем потерявшим веру учителям, что люди проснулись и готовы бороться;
4) те кто нарушал, позже расскажут об этом и будет основание посадить нарушителей; 
5) проверить свои силы в условиях противодействия, увидеть лица, обрести уверенность - это очень важно, увидеть друга и соратника!

@dover Athletic знаете, уже давно, и чем дальше, тем сильнее, создаётся впечатление, что он ничем не правит и ничего не контролирует.
Помните знаменитое володинское "наше богатство - Путин"? Вот это вполне похоже на правду. ИХ богатство - Путин. Удобная фигура с кредитом доверия, которая всегда поможет смягчить недовольство и отведёт глаза от деяний нечистых на руку "бояр".

Потому скорее всего и не Путин пытается через поправки остаться у власти. А они через Путина. Совсем не кажется удивительной ситуация, в которой его самого касательно многих вещей держат в неведении, освещая события только с "нужной" стороны. Посадили царя в бункер, от интернета отрезали, всех недовольных заклеймили интервентами и шпионами - и рассказывают, как народ его любит, собирают встречи с подставными лицами, организовывают нужные рейтинги и результаты опросов.

@Максим Кац, а как же коронавирус? Даже если всем тем, кто против раздадут противогазы - их всё равно заставят снять их на участке, а это - высокий риск заражения.
UPD: Досмотрел до момента, где про это говорится, но всё же я не соглашусь. Не готов поставить свою жизнь и жизнь своих близких, учитывая риски заражения.
В целом я согласен с мнением, что бойкот ни к чему не приводит вообще, но в нынешней ситуации - это лучше, чем идти на участок с риском заражения.

@Stanislav Palyutin но низкая явка ничего не изменит. Сколько бы ни пришло людей, главное это конечное соотношение голосов - от него будет зависеть, что произойдёт дальше. Даже если придёт 10-20% (что невозможно - свой электорат они пригонят, особенно сейчас когда они "победили" пандемию) - это не создаст никакого прецедента. Они просто получат свои больше 50% "За" без каких-либо  фальсификаций,  собирая голоса приведенных и самостоятельно пришедших сторонников. Без нас им вообще не придется ничего фальсифицировать и пользоваться своими механизмами псевдореферендума! 

С нами же им придется ухищряться, им придется нарушать, им придётся врать. А мы будем за этим следить.

В этом законе переписаны не все формальности выборов! Они облегчили себе путь к фальсификациям, но это по-прежнему не красная ковровая дорожка. Пустые бюллетени не пришедших - основа фальсификаций. Именно их и будут превращать в фальшивые голоса За. Не придя, вы просто ещё больше упростите им задачу. Нам нужны голоса Против и много наблюдателей. В каждую палатку, к каждой выносной урне.

Всё правильно, но:
- Голосование будет растянуто на неделю;
- Пронаблюдать за подсчётом будет невозможно;
- Всё оппозиционные или псевдооппозиционные акторы, как обычно, убедили свой электорат бойкотировать;
- Апатия игнорирующих выборы ждунов дополнительно подкреплена эпидемиологической обстановкой;
- В самом лучшем случае 40- тысяч человек посмотревших ваш ролик проголосуют и в конечном итоге будут деморализованы результатом.
Остаётся только педалировать в СМИ и блогсфере тему, что Путин ради своего обнуления ведёт на убой граждан зазывая их на парады и голосование в то время, когда каждые сутки выявляется 9 тысяч заболевших COVID. Ход с голосованием против уже проигран. Нужно выжать из этого проигрыша как можно больше пользы для следующего шага.

