@Дмитрий Гавриилович Только минуту назад писал о том, что когда Кацу нужно, он умалчивает о некоторых важных вещах, но повторюсь. Смотрите других блогеров, чтобы составить правильное мнение. На всякий случай скажу, что я не против Каца. Наоборот очень люблю его видео, и смотрю каждое, но вот с тем, что связано с голосованием не согласен.
Теперь отвечаю по теме. Мнение народа игнорируют уже не первый год. Я всегда хожу и на выборы президента, и на выборы мэра Москвы (последний раз только не голосовал, потому что переехал в другой город). Даже на муниципальные выборы иногда хожу, хотя не всегда. Я не верю в то, что Единая, мать ее, Россия каждый раз набирает большинство. Десять лет назад, может быть, но последние 2 года, начиная с пенсионной реформы, точно нет. Но они почему-то каждый раз выигрывают.
Ну а закончу тем, что соглашусь с комментарием, который был где-то совсем уже ниже. Ни одни выборы уже ничего не изменят. Путинская хунта так укоренилась, что мирно власть уже не отдадут, даже если 100% людей будут против. Если надо будет людей расстреливать, то начнут расстреливать.

