@martin bukalo много пунктов повторяется, так что отвечу не по пунктам, а на все. Фальсификации будут 100%. С большой долей вероятности их удастся засечь, как было на прошлых выборах, что вызовет недовольство и недоверие к самой процедуре. Если же придет мало народа (а силовиков и бюджетников точно сгонят голосовать, так что маленькая явка, но будет), они под камеры честно посчитают голоса. А потом будет "докажи, что не ходил".
Насчет пропагандонов можешь даже не париться. На пару участков свезут побольше народа и снимут очереди. Потом будут говорить по говноканалам о высокой явке. Тем более, как ты говоришь, явку могут нарисовать.
Голосуя против, мы даем понять тем, кому это интересно (есть такие люди), то, что реальный рейтинг путина и его поправок около нуля. Если же мы не выйдем, то эти люди подумают, что "да, рейтинг маленький, но все сидят на диванах и аполитичны, так что мы и дальше будем с путиным работать"

