А именно - после выборов объявят что явка была высокой (60 - 70%), а "за" было 70 - 80%.  При том что реальная явка будет меньше 50%, а количество "за" ты никак не узнаешь, и никто не узнает, даже члены комиссий, потому что бюллютени будут считать совсем не на УИКах. Вот тогда ты и поймешь что тебя в очередной раз поимели. По крайней мере до этого у Путина постоянно получалось тебя иметь. Не понимаю что помешает ему в очередной раз это сделать. Контроля-то вообще нет, Памфилову никто не осудил за преступления, все фальсификаторы на местах. В том числе и у нас в Приморье, когда выборы отменили из-за фальсификаций (уголовное преступление вообще-то), но даже не завели никаких дел.
Да, у Путина легко полчается иметь тех кто признает легитимность власти, а значит и ее право устраивать вот такие вот голосования, т.е. "спрашивать мнение".  Если ты готов идти и выскзаываться, то ты признаешь заведомо правила, и не можешь бухтеть если проиграешь (а то что ты проиграешь ты и сам понимаешь). В этом и есть фокус опускания в парашу башкой. Не знаю кто такой этот Кац, но он не видит дальше своего носа.

